import React, { Component } from "react";
import VideoItem from "../videoItem/videoItem";

class VideoList extends Component {
  state = {
    items: [
      {
        title: "How to prepare a great beer",
        type: "video",
        source: "facebook",
        videoId: "1052114818157758",
        views: 4569654
      },
      {
        type: "video",
        source: "url",
        url: "http://cdn.playbuzz.com/content/feed/video-1.mp4",
        views: 8820
      },
      {
        title: "Be a winner!",
        type: "video",
        source: "youtube",
        views: 12451409
      },
      {
        title: "Top 10 fastest cars in the world",
        type: "video",
        source: "youtube",
        videoId: "h8MbhS5XKow",
        views: 25560867
      },
      {
        title: "A funny dog barking",
        type: "video",
        source: "youtube",
        videoId: "MveqXxB12YA",
        views: 4287171
      }
    ],
    expextedKeys: ["title", "views", "videoId"],
    urlExtensions: {
      facebook: "https://www.facebook.com/facebook/videos/",
      youtube: "https://www.youtube.com/embed/",
      itemNotFound:
        "https://cdn.dribbble.com/users/447357/screenshots/2816714/404-800.gif"
    }
  };
  render() {
    return <div>{console.log(this.mapArray())}</div>;
  }

  mapArray() {
    const { urlExtensions } = this.state;
    const self = this;
    return this.state.items.map(function(value, index) {
      if (!self.checkItemKeys(Object.keys(value))) {
        return {
          url: urlExtensions["itemNotFound"]
        };
      }

      return {
        url: urlExtensions[value.source] + value["videoId"]
      };
    });
  }

  checkItemKeys(itemKeys) {
    let { expextedKeys } = this.state;

    if (itemKeys.length === 0) {
      return false;
    }

    return expextedKeys.every(function(val, index) {
      return itemKeys.indexOf(val) > 0;
    });
  }
}

export default VideoList;
